import React from 'react';

import {
  Photo
} from './styles';

function CheckoutDesktop(props) {
  return (
    <Photo>
      <img src={props.location.state.MaxresURL} alt="Product" />
    </Photo>
  );
};

export default CheckoutDesktop;
